import { Pie } from "react-chartjs-2";
const IncExpChart = ({ totalIncome, totalExpense }) => {
  return (
    <div>
      <Pie
        data={totalIncome}
        options={{
          title: {
            display: true,
            text: "Average Rainfall per month",
            fontSize: 20,
          },
        }}
      />
    </div>
  );
};
export default IncExpChart;
